import React from "react";
import "../components/styles/Header.css"

export default function Header() {
    return (
        <nav>
            <div>
                <a href="#">About</a>
                <a href="#">Events</a>
                <a href="#">Ministries</a>
                <a href="#">Give</a>
            </div>
        </nav>
    )
}
